import { Image, type ImageProps } from 'expo-image';
import type React from 'react';
import { useMemo } from 'react';
import { Platform, StyleSheet } from 'react-native';
import { SvgUri } from 'react-native-svg';

const NFTIcon: React.FC<ImageProps & { isNftItem?: boolean }> = ({ style, isNftItem, ...props }) => {
  const needRenderSVG = useMemo(() => Platform.OS === 'ios' && typeof props.source === 'string' && props.source.endsWith('svg'), [props.source]);

  if (needRenderSVG) {
    return <SvgUri style={[styles.container, typeof style === 'object' && style]} uri={props.source as string} />;
  }

  return (
    <Image
      style={[styles.container, typeof style === 'object' && style]}
      placeholder={isNftItem ? defaultItem : defaultIcon}
      placeholderContentFit="contain"
      contentFit="contain"
      {...props}
    />
  );
};

const styles = StyleSheet.create({
  container: {
    borderRadius: 100,
  },
});

export default NFTIcon;

const defaultIcon =
  'data:image/png;base64,';

const defaultItem =
  'data:image/png;base64,';
